import React from 'react';
import { Container } from 'react-bootstrap';
import './Header.css';

const Header = () => {
  return (
    <header className="dhl-header">
      <div className="dhl-header-left">
        <img 
          src="https://www.dhl.com/content/dam/dhl/global/core/images/logos/dhl-logo.svg" 
          alt="DHL Logo" 
          className="dhl-logo"
        />
        <h1 className="dhl-header-title">eCS DE UC UI</h1>
      </div>
      <div className="dhl-header-right">
        <span className="dhl-user-info">Welcome to DHL eCS</span>
      </div>
    </header>
  );
};

export default Header;
